import React, { useState, useEffect } from "react";
import ReactMapGl, { Marker, Popup } from "react-map-gl";
const access_token =
  "pk.eyJ1Ijoic2F1bGlrIiwiYSI6ImNrcWM4NXJoYzAwdzkybm56djVka2VzZW0ifQ.QmYDZh6DNEwu5ITY9lQ6Ag";

function Map(props) {
  const [viewport, setViewport] = useState({
    latitude: 62,
    longitude: 25,
    zoom: 5,
  });

  const [maakunta, setMaakunta] = useState(props.maakunta);
  const [tyyppi, setTyyppi] = useState(props.tyyppi);

  useEffect(() => {
    //console.log("Props:", props);
    console.log("Maakunta:", maakunta);
    console.log("Tyyppi:", tyyppi);
  }, []);

  const addMarkers = () => {};

  console.log("map rendered");
  console.log("Mapissa maakunta: ", maakunta);
  console.log("Mapissa tyyppi: ", tyyppi);

  return (
    <ReactMapGl
      className="map"
      {...viewport}
      mapboxApiAccessToken={access_token}
      mapStyle="mapbox://styles/mapbox/streets-v11"
      height={800}
      width={600}
      onViewportChange={(viewport) => {
        setViewport(viewport);
      }}
    >
      {addMarkers()}
    </ReactMapGl>
  );
}

export default Map;
